import { PDFViewer, Document, Page, pdfjs } from 'react-pdf';
pdfjs.GlobalWorkerOptions.workerSrc = new URL(
  "pdfjs-dist/build/pdf.worker.min.mjs",
  import.meta.url
).toString();

function LectionPage() {
  return (
    <PDFViewer>
      <Document file={'/test.pdf'}>
        <Page pageNumber={1} />
      </Document>
    </PDFViewer>
  );
}
export default LectionPage;
